def fetch_CWE_values(cve_id):
    """"
    This function identifies the corresponding CWE value for a CVE value
    and adds the CWE entry to the dictionary
    my_dictionary[cve1] = cwe1
    """


    # Define the base API URL
    base_url = 'https://services.nvd.nist.gov/rest/json/cves/2.0?cveId='

    # Your API key
    api_key = 'dfc24959-d1cc-46c1-a06b-073ad7007981'  # Replace with your actual API key

    url = base_url + cve_id.strip()  # strip() removes any leading/trailing whitespace

    headers = {
        'apiKey': api_key
    }

    # Make the GET request
    response = requests.get(url, headers=headers)

    # Check if the request was successful
    if response.status_code == 200:
        data = response.json()
        try:
            # Navigate the JSON structure to find the CWE detail
            cwe_detail = data['vulnerabilities'][0]['cve']['weaknesses'][0]['description'][0]['value']

            if cwe_detail == "NVD-CWE-noinfo" or cwe_detail == "NVD-CWE-Other":
                cwe_detail = data['vulnerabilities'][0]['cve']['weaknesses'][1]['description'][0]['value']

            my_dictionary[cve_id] = cwe_detail
            # print(f"CVE ID: {cve_id}, CWE Detail: {cwe_detail}")
            print(f"{cve_id},{cwe_detail}")

        except (IndexError, KeyError):
            print(f"{cve_id}, CWE Detail not found")
    else:
        print(f"{cve_id} request failed with status code: {response.status_code}")


def identify_CWE_values(cve_list):
    """
    This function identifies the corresponding CWE value for a given bulk CVE list.
    """

    for cve in cve_list:
        fetch_CWE_values(cve)
        time.sleep(1)


def draw_histogram(data):
    cwe_values = [value for value in data.values() if value.startswith('CWE-')]

    # Use Counter to count the frequency of each CWE value
    cwe_counts = Counter(cwe_values)

    # Create a bar diagram showing the frequency of each CWE
    plt.figure(figsize=(10, 6))
    plt.bar(cwe_counts.keys(), cwe_counts.values(), color='blue')

    # Add labels and title
    plt.xlabel('CWE Values')
    plt.ylabel('Frequency')
    plt.title('Frequency of CWE Values')

    # Show the plot
    plt.show()


def draw_top_five_threats_diagram(data, component_name):
    cwe_values = [value for value in data.values() if value.startswith('CWE-')]

    # Use Counter to count the frequency of each CWE value
    cwe_counts = Counter(cwe_values)

    # Get the top 5 most common CWE values
    top_5_cwe = cwe_counts.most_common(5)

    # Unpack the top 5 for plotting
    labels, counts = zip(*top_5_cwe)

    # Calculate the total occurrences for percentage conversion
    total_counts = sum(cwe_counts.values())

    # Convert counts to percentages
    percentages = [(count / total_counts) * 100 for count in counts]

    # Create a bar diagram showing the top 5 CWE values
    plt.figure(figsize=(10, 6))
    plt.bar(labels, percentages, color='blue')

    # Add labels and title
    plt.xlabel('CWE Values')
    plt.ylabel('Percentage')
    plt.title('Top 5 Most Frequent CWE Values (Percentage) for ' + component_name)

    # Format y-axis ticks as percentages
    plt.gca().yaxis.set_major_formatter(plt.FuncFormatter(lambda x, _: f'{x:.0f}%'))

    # Show the plot
    plt.show()


def output_top_five_threats(data):
    cwe_values = [value for value in data.values() if value.startswith('CWE-')]

    # Use Counter to count the frequency of each CWE value
    cwe_counts = Counter(cwe_values)

    # Get the top 5 most common CWE values
    top_5_cwe = cwe_counts.most_common(5)

    # Unpack the top 5 for plotting
    labels, counts = zip(*top_5_cwe)

    f = open("top_five_threats.txt", "a")
    for i in labels:
        f.write(str(i) + '\n')
    f.close()


def output_all_threats(data):
    cwe_values = [value for value in data.values() if value.startswith('CWE-')]

