def update_identify_CWE_values(cve_list, dictionary):
    for cve in cve_list:
        update_fetch_cwe_values(cve, dictionary)
        time.sleep(1)


def update_fetch_cwe_values(cve_id, dictionary):
    # Create a session
    session = requests.Session()

    # Define a retry strategy
    retry_strategy = Retry(
        total=5,  # Total number of retries
        backoff_factor=1,  # Waits 1 second between retries, then 2s, 4s, 8s...
        status_forcelist=[429, 500, 502, 503, 504]  # Status codes to retry on
    )

    # Mount the retry strategy to the session
    adapter = HTTPAdapter(max_retries=retry_strategy)
    session.mount("http://", adapter)
    session.mount("https://", adapter)

    # Define the base API URL
    base_url = 'https://services.nvd.nist.gov/rest/json/cves/2.0?cveId='

    # Your API key
    api_key = 'dfc24959-d1cc-46c1-a06b-073ad7007981'  # Replace with your actual API key

    url = base_url + cve_id.strip()  # strip() removes any leading/trailing whitespace

    headers = {
        'apiKey': api_key
    }

    # Make the GET request
    response = requests.get(url, headers=headers)

    # Check if the request was successful
    if response.status_code == 200:
        data = response.json()
        try:
            # Navigate the JSON structure to find the CWE detail
            cwe_detail = data['vulnerabilities'][0]['cve']['weaknesses'][0]['description'][0]['value']

            if cwe_detail == "NVD-CWE-noinfo" or cwe_detail == "NVD-CWE-Other":
                cwe_detail = data['vulnerabilities'][0]['cve']['weaknesses'][1]['description'][0]['value']

            dictionary[cve_id] = cwe_detail
            # print(f"CVE ID: {cve_id}, CWE Detail: {cwe_detail}")
            print(f"{cve_id},{cwe_detail}")

        except (IndexError, KeyError):
            print(f"{cve_id}, CWE Detail not found")
    else:
        print(f"{cve_id} request failed with status code: {response.status_code}")
    return


